1. Mes įsipareigojame apsaugoti mūsų programos vartotojų privatumą; šia privatumo sutartimi paaiškiname, kaip bus elgiamasi su jūsų asmenine informacija.
2. Galime rinkti, saugoti ir naudoti šią asmeninę informaciją:
* Informaciją apie jūsų įrenginį ir apie jūsų apsilankymą ir naudojimąsi šia programėle (įskaitant jūsų IP adresą, geografinę vietą, operacinės sistemos, naršyklės tipą ir versiją, kreipimosi šaltinį, apsilankymo trukmę ir naršymo poelgius);
* Informaciją, kurią pateikiate mums registruodamiesi;
* Jūsų el. paštą ir vardą, kai susikuriate profilį;
* Informaciją, kurią įvedate pildant savo šuns profilį mūsų programėlėje;
* Informaciją, kurią siunčiate mums tiesiogiai rašydami, įskaitant komunikacijos turinį ir metaduomenis, susijusius su komunikacija;
* asmeninę informaciją, kurią pasirenkate siųsti mums.
3. prieš pateikiant mums asmeninę informaciją apie kitą asmenį, privalote gauti šio asmens sutikimą atskleisti ir apdirbti, vadovaujantis šia privatumo politika.
4. Galime naudoti jūsų asmeninę informaciją: 
* pritaikyti mūsų platformas jums;
* Siųsti elektroninio pašto pranešimus, jums davus užklausą;
* Atsiųsti mūsų elektroninį informacinį laišką, jei užsisakysite jį (galite pranešti mums bet kuriuo metu, jei nebenorite jo gauti);
* Jums siųsti rinkodaros pranešimus, susijusius su mūsų partneriais ( atidžiai atrinktos trečiųjų šalių įmonės), kurie mūsų manymu, gali jums būti įdomūs, elektroniniu paštu arba panašia technologija (jūs galite informuoti mus adresu bet kuriuo metu, jei norite atsisakyti rinkodaros pranešimų);
* Suteikti tretiems asmenims statistinę informaciją apie mūsų vartotojus ( trečiosios šalys negalės identifikuoti pavienių vartotojų);
* Nagrinėdami užklausas ir skundus apie mūsų programėlę;
* Apsaugoti ir užkirsti kelią sukčiavimui mūsų programėlėje.
5. Be jūsų sutikimo, neteiksime jūsų asmeninės informacijos jokiai trečiajai šaliai, kuri galėtų panaudoti jūsų duomenis marketingo tikslais.
6. Asmeninę informaciją nėra saugoma ilgiau nei būtina aukščiau išvardytiems tikslams.
7. įkelta medija: 
* jūs užtikrinate, jog esate turinio savininkas ir turite leidimą, visų šalių, kurios į ją įtrauktos, publikuoti.
* Video egzaminai yra saugomi mūsų serveriuose, jog vėliau galėtumėte peržiūrėti juos savo programėlės paskyroje. Mes nesidaliname video egzaminais rinkodaros tikslais arba su trečiosiomis šalimis, arba su kitais vartotojais.
* Mes turime teisę dalintis mediją, kurią įkėlėte į "Iššūkių" kategoriją, rinkodaros tikslais.
* Paprašius, mes visada panaikinsime turinį, kurį jūs pateikėte mums.
8. Mes saugosime dokumentus (įskaitant elektroninius dokumentus), kuriuose nurodyta jūsų asmeninė informacija:
* laikotarpį, kuris nurodytas pagal įstatymą;
* Jei manome, kad dokumentai gali būti naudingi teismo procese; 
* siekiant nustatyti, įgyvendinti ar ginti savo teises (įskaitant tiekimą informacijos kitiems sukčiavimo prevencijos tikslais ir sumažinti kredito riziką).
9. mes imsimės pagrįstų techninių ir organizacinių atsargumo priemonių siekiant išvengti nuostolių, netinkamo naudojimo arba pakenkimo jūsų asmeninei informacijai.
10. saugosime visą pateiktą asmeninę informaciją mūsų uždaruose serveriuose (apsaugotuose ugniasienės - slaptažodžiu).
11. jūs suprantate, kad perduoti informaciją internetu yra potencialiai nesaugu ir mes negalime garantuoti duomenų saugumo, siunčiamų internetu.
12. Jūs esate atsakingas už savo slaptažodį, kurį naudojate prisijungimui prie mūsų programėlės konfidencialumo; Mes neprašysime jūsų įvesti slaptažodžio (išskyrus tuos atvejus, kai bandysite prisijungti prie mūsų programos).
13. Jūs galite duoti mums užklausą pataisyti, ištraukti arba ištrinti visą jūsų asmeninę informaciją, susisiekdami su mumis elektroniniu paštu arba pranešimų sistema programos viduje.
14. Mūsų programėlė apima nuorodas ir išsamią informaciją apie trečiųjų šalių interneto svetaines ir mes negalime kontroliuoti ir neatsakome už privatumo politiką ir praktiką, trečiųjų šalių.
15. Mes turime teisę atnaujinti šią privatumo politiką, paskelbdami naują versiją mūsų programėlėje ir informuodami jus apie šios sutarties pakeitimus.
16. Ši programėlė yra valdoma ir eksplotuojama Dogo App UG. Daugiau informacijos apie mus: * mūsų pagrindinė verslo vieta yra Markgrafenstrasse 12-14, 10969, Berlin, Vokietija.
* Duomenų apsaugos pareigūnas: Tadas Žiemys, tadas@dogo.app
